{"code":0,"msg":"ok","data":{"bindUserCode":"","detail":{"basicInfo":{"activePeriodText":"出生以来","avatarKey":"","description":"“三项统一” 是我的目标\n\n永远年轻，永远坚持本心，也永远热泪盈眶；我认为，我的生活就是在协调三类事情：学习、技术和人际交往。在未来，我的学习能力、生活能力和技术带给我的能力将创造非凡的力量，协助我走向我梦想中的灿烂人生。\n\n“飞离地球” 是我的向往\n\n讨厌去做千篇一律的事情；自幼喜欢哆啦A梦的我，想象力是我的翅膀。我认为，生命中丰富多彩的可能性，才是世界最可爱的地方；代码是我的笔，文字也是我的笔，我喜欢在现实的基础上再加工，不断设想和升华。\n\n编写程序 是我的爱好\n\n从小学开始接触VB编程的我，现在可以使用多种语言进行创作。除了你正在浏览的个人网站，本人还完成过天骁随记Android客户端、砾风在线编译器、学生会招新系统、中/高考成绩录取查询系统等诸多得意之作。\n\n美好生活 是我的期望\n\n一杯茶，一本书，一段音乐，一隅美景，都可以组成美好生活的形态；如何发挥我拥有的优势，让一切都变得可爱起来；如何在生命中遇到对的人，有梦想，要乐观，不乏味，知兴替。","displayName":"孙天骁","englishName":"Tianxiāo Sun","extraData":"{}","gender":1,"genderGreet":"他","isLover":false,"isSpecial":false,"name":"孙天骁","priority":0,"relation":"本人","score":0,"subPriority":1,"summary":"95后，吉林人\n\n现暂居杭州，前端开发职务\n\n喜欢数码产品，喜欢哆啦A梦\n\n喜欢有创造性的东西，喜欢编程、开发网站，喜欢记录生活\n\n欢迎过来认识我，与我成为朋友"},"bindUserInfo":{"exists":false,"introduction":"","summary":{"exists":false,"name":"","code":"","alias":"","description":"","homepageUrl":"/404","group":0,"groupName":"普通用户","isLocked":false,"gender":0,"avatarUrl":"/common/person.jpg","realName":"","refBaike":"","isManager":false,"isMe":false,"isLover":false,"introduction":"","joinTime":"0001-01-01 00:00:00"}},"entries":{"links":[]},"gallery":{"list":[]},"impressions":{"list":[]},"indexID":331,"keyWords":{"words":[]},"mentionArticles":{"list":[{"id":338,"isGood":false,"title":"一些事","urlCode":"2FB0E13386"},{"id":337,"isGood":false,"title":"齐齐哈尔的11条生命，你们走好","urlCode":"57531A9DB8"},{"id":336,"isGood":false,"title":"消息中心支持发送图片了~","urlCode":"message-improve"},{"id":335,"isGood":false,"title":"早期的骁之屋","urlCode":"early-ybusad"},{"id":334,"isGood":false,"title":"のんびりした場所\n（悠闲的场所）","urlCode":"701794FF9D"},{"id":333,"isGood":false,"title":"我的爷爷","urlCode":"my-grandpa"},{"id":332,"isGood":false,"title":"鼓浪屿","urlCode":"gulangyu"},{"id":331,"isGood":false,"title":"抗癌之旅其六","urlCode":"FD6986EC56"},{"id":330,"isGood":false,"title":"记第一次组装电脑","urlCode":"make-a-computer"},{"id":